import './App.css';
import { ReactSketchCanvas } from "react-sketch-canvas";

function App() {

  const styles = {
    border: "0.0625rem solid #9c9c9c",
    borderRadius: "0.25rem",
  };

  const Canvas = () => {
    return (
      <div className="App">
        <ReactSketchCanvas
          style={styles}
          width="600"
          height="400"
          strokeWidth={4}
          strokeColor="red"
        />
      </div>
    );
  };
}

export default App;
